import axios from "axios";
import { useState } from "react";
import EmpService from "../services/EmpService";
import { useDispatch, useSelector } from "react-redux";
import { setById } from "../redux/EmpSlice";

const EmpById = () => {
    const [empData, setEmpData] = useState("");
    const [empById, setEmpById] = useState('');
    const dispatch = useDispatch();
    const employeeById = useSelector(state => state.emp.byIdEmp)

    const handleChange = (evt) => {
        //setEmpData({ ...empData, [evt.target.name]: evt.target.value });
        setEmpById(evt.target.value)
    }

    const handleSubmit = (evt) => {
        evt.preventDefault();

        console.log(employeeById);
        //axios.get(`http://localhost:9090/emp/get-emp-by-id/${empData}`)
        EmpService.getEmpById(employeeById)
        .then((resp) => {
            console.log(resp);
            setEmpData(resp);
            dispatch(setById(resp));
        })
        .catch(error => {
            console.log(error);
           alert("Employee doesnt exist") 
        });
    };

    return (
        <div className="container mt-3">
            <h1>Employee by Id</h1>
            <div className="col-4">
            <form onSubmit={handleSubmit}>
                <label htmlFor="employeeId">Employee Id:</label>
                <input className="form-control" type="text" id="empById" name="empById" value={employeeById} onChange={handleChange} placeholder="Enter employee id" required  />
                <br/>
                <input className="form-control btn btn-outline-light"type="submit" value="get employee with id"/>
            </form>
            </div>
            <div>
                <h3>Employee</h3>
                <h1 className="container mt-3">  Employee found : </h1>

                    <table className="container text-left">
                        <thead className="row">
                                <th className="col">id</th> 
                                <th className="col">Name</th> 
                                <th className="col ">Salary</th> 
                                <th className="col">Aadhar</th>
                                <th className="col">email</th>
                            
                        </thead>
                        <tbody>
                        {/* {empData && empData.map(emp => ( */}
                                <tr className="row" >
                                    <th className="col" >{empData.employeeId}</th>
                                    <th className="col">{empData.firstName}</th>
                                    <th className="col">{empData.salary}</th>
                                    <th className="col">{empData.aadhar}</th>
                                    <th className="col">{empData.email}</th>
                                </tr>
                            
                        </tbody>
                    </table>
                
            </div>
        </div>
    );
}
 
export default EmpById;

